def proc_exist(process_name):
  pl = psutil.pids() 
  for pid in pl:
    if psutil.Process(pid).name() == process_name: 
      return True 
  return False 
if proc_exist('Palia.exe'):
  print('游戏已运行')
else:
  print('正在尝试启动游戏')
